import Sign_up from "./component/Sign_up";
import Merchant_login from "./component/Merchant_login";
import { Route, Routes, Link } from "react-router-dom";

import "./App.css";
function App() {
  return (
    <div className="App">
      <Sign_up />

      <Link to="/"></Link>
      <Link to="Merchant_login"></Link>
      <Link to="page2"></Link>
      <Link to="page3"></Link>

      <Routes>
        <Route path="/" element={<Sign_up />} />
        <Route path="/" element={<About />} />
      </Routes>
    </div>
  );
}

export default App;
